import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

function Header(props) {
  const { token } = props;

  return (
    <div>
      <nav className="header">
        <h2 className="logo">BLOG APP</h2> {/* JSX*/}
        <div className="articles">
          <Link className="link" to="/">
            Home
          </Link>
          <Link className={token ? "hidden" : "link"} to="/login">
            Login
          </Link>
          <Link className={token ? "hidden" : "link"} to="/signup">
            Signup
          </Link>
          <Link className={!token ? "hidden" : "link"} to="/about">
            About
          </Link>
          <Link className={!token ? "hidden" : "link"} to="/article-list">
            Articles
          </Link>
          <Link className={!token ? "hidden" : "logout"} to="/logout">
            Logout
          </Link>
        </div>
      </nav>
    </div>
  );
}

export default Header;
